import React from "react";
import "./Style.css";

export default function Sidebar({ allHistory }) {
  return (
    <div className="sidebar">
      <h3>üìú History</h3>
      {(!Array.isArray(allHistory) || allHistory.length === 0) && (
        <div className="placeholder">No history yet</div>
      )}
      <ul>
        {Array.isArray(allHistory) &&
          allHistory.map((h, i) => (
            <li key={i} className="history-item">
              <b>{h.type === "image" ? "üñºÔ∏è" : "üí¨"}</b> {h.userMessage}
              <div className="history-reply">‚Ü≥ {h.botReply}</div>
            </li>
          ))}
      </ul>
    </div>
  );
}
